	// Check bingos
	function removeDuplicateCharacters(string) {
		return string
		  .split('')
		  .filter(function(item, pos, self) {
			return self.indexOf(item) == pos;
		  })
		  .join('');
	  }
	function isbingo(word){
		newword=removeDuplicateCharacters(word)
		return(newword.length)
	}

	
