	// status function 
	function statusfct(guessedwords,totalwords){
		// share guessed

		gw=guessedwords/totalwords
		mymessage=""
		//
		if (gw==0){
			mymessage="I dag er der "+totalwords+" ord."
		}
		else if (gw>0&gw<0.2){
			mymessage="Ordsmedelærling!"+" ("+guessedwords+"/"+totalwords+")";
		}
		else if (gw<0.4){
			mymessage="Ordsmedemester!"+" ("+guessedwords+"/"+totalwords+")";
		}
		else if (gw<0.6){
			mymessage="Ordsmedeveteran!"+" ("+guessedwords+"/"+totalwords+")";
		}
		else if (gw<0.8){
			mymessage="Ordsmedegeni!"+" ("+guessedwords+"/"+totalwords+")";
		}
		else if (gw<1){
			mymessage="Ordsmedetrold!"+" ("+guessedwords+"/"+totalwords+")";
		}
		else if (guessedwords==totalwords){
			mymessage="Tillykke. Du har gættet alle ord!"
		}

		document.getElementById('region_gameprogress').innerHTML = mymessage

	}
		
