// ---------------------  message function  --------------------- //


function message(checkresult) {
	// block writing
	lastprinted="PAUSE"
	// make font red
	document.getElementById("region_maintext").style.fontSize ="30px";
	//document.getElementById("region_maintext").style.color ="#4CAF50";
	
	document.getElementById("region_maintext").style.fontFamily  ='Architects Daughter';
	// print message depending on check outcome
	if (checkresult=="alreadyguessed"){
			// Correct word, but already guessed
			document.getElementById('region_maintext').innerHTML = "<br>Du har allerede gættet dette ord.";
	}
	if (checkresult=="guessedword"){
		// send positive message

		document.getElementById('region_maintext').innerHTML = "<br>Korrekt. Godt gået! ";
	}
	if (checkresult=="bingo"){
		// send positive message
		document.getElementById("region_maintext").style.fontSize ="40px";
		document.getElementById('region_maintext').innerHTML = "<br>Bingo! ";
	}
	if (checkresult=="nowordentered"){
		document.getElementById('region_maintext').innerHTML = "<br>Du har ikke skrevet noget.";
	}
	if (checkresult=="noredletter"){
		document.getElementById('region_maintext').innerHTML = "<br>Det røde bogstav indgår ikke i dit ord. Prøv igen.";
	}
	if (checkresult=="Allguessed"){
		document.getElementById('region_maintext').innerHTML = "<br>Tillykke! Du har gættet alle ord!";
	}

	if (checkresult=="not4letters"){
				if (level=="hard"){
						document.getElementById('region_maintext').innerHTML = "<br>Ordet skal bestå af mindst fire bogstaver. Prøv igen.";
		}
		else if 
			(level=="easy"){
					document.getElementById('region_maintext').innerHTML = "<br>Ordet skal bestå af mindst tre bogstaver. Prøv igen.";
		}
		}
	
	if (checkresult=="wordnotvalid"){
		document.getElementById('region_maintext').innerHTML = "<br>Ordet er ikke i ordbogen. Prøv igen."
	}
	// make content black again
	setTimeout(function(){ 
		if (lastprinted!="BOGSTAV"){
			document.getElementById('region_maintext').innerHTML = "";
			document.getElementById("region_maintext").style.fontSize ="35px";
			document.getElementById("region_maintext").style.color="black";
			document.getElementById("region_maintext").style.fontFamily  ="Lucida Sans Unicode";
			lastprinted="BOGSTAV";
		}
	}, 5000);
}


// ---------------------  check word  --------------------- //
	// Check word
	function check_word() {
		// Check if intered a letter
		if (lastprinted=="BOGSTAV"){
		// Store the entered word
		var newword=document.getElementById('region_maintext').innerHTML.trim();
		// HARD 
					if (level=="hard"){
					// check if entered word is in word list
					check=words_hard.indexOf(newword);
					// Do if check is okay
					if (check!= -1) { 
						// if already guessed
						if (guessedwords_hard.indexOf(newword)!= -1){
							message("alreadyguessed")	
						} else {
							// check if bingo
							if (isbingo(newword)==7){
								message("bingo")	
							}
							else {
								message("guessedword")	
							}
							// add word to list
							guessedwords_hard.push(newword)	
							// update guessed counter
							guessed_hard=guessedwords_hard.length;
							// updatetext
							//document.getElementById('region_gameprogress').innerHTML = "Du har gættet "+guessed+" ud af "+total+" ord. ";
							statusfct(guessed_hard,total_hard)
							// store
							store()
							if (guessed_hard==total_hard){
								message("Allguessed")
							}
						}
					// If word was not in word list
					}else{
						// Convert entered word to string
						const stringedletters = newword.split("");
						// Did not write anything
						if (stringedletters.length==0){
							message("nowordentered")	
						//check if first letter is included
						} else if (stringedletters.indexOf(letters_hard[0])== -1){
							message("noredletter")	
						// check if 4 letters
						} else if (stringedletters.length<4){
							message("not4letters")
						// else word not in list
						} else{
							message("wordnotvalid")
						}
					
					}
		}
		// EASY
			else if (level=="easy"){
					// check if entered word is in word list
					check=words_easy.indexOf(newword);
					// Do if check is okay
					if (check!= -1) { 
						// if already guessed
						if (guessedwords_easy.indexOf(newword)!= -1){
							message("alreadyguessed")	
						} else {
							// check if bingo
							if (isbingo(newword)==4){
								message("bingo")	
							}
							else {
								message("guessedword")	
							}
							// add word to list
							guessedwords_easy.push(newword)	
							// update guessed counter
							guessed_easy=guessedwords_easy.length;
							// updatetext
							//document.getElementById('region_gameprogress').innerHTML = "Du har gættet "+guessed+" ud af "+total+" ord. ";
							statusfct(guessed_easy,total_easy)
							// store
							store()
							if (guessed_easy==total_easy){
								message("Allguessed")
							}
						}
					// If word was not in word list
					}else{
						// Convert entered word to string
						const stringedletters = newword.split("");
						// Did not write anything
						if (stringedletters.length==0){
							message("nowordentered")	
						//check if first letter is included
						} else if (stringedletters.indexOf(letters_easy[0])== -1){
							message("noredletter")	
						// check if 3 letters
						} else if (stringedletters.length<3){
							message("not4letters")
						// else word not in list
						} else{
							message("wordnotvalid")
						}
					
					}
		}
		}

}


// ------------------------  create buttons  ------------------------ //

	function create_buttons(){
		var button, holder;
		// HARD
		if (level=="hard"){
				// list of seven letters randomly reshuffled
				list=[0,1,2,3,4,5,6].sort( () => .5 - Math.random() );
				// clear letters
			    document.getElementById('region_letters').innerHTML ="";
			    // holder for letter space
			    holder = document.getElementById( "region_letters" );
			    // loop over letter list
			  	for( j = 0; j < 7;  j++) {
			  		// find corresponding letter
			  		i=list[j]
			  		// create a button element
			        button = document.createElement( "button" );
			        // set inner element of button to the letter
			        button.innerHTML = letters_hard[i];   
			        // set an attribute
			        button.setAttribute( "data-letter", letters_hard[i] );
			        // make first letter red 
			        if (i==0){
			        	button.style.color = 'red'; // setting the color to red
			        }
			        // functionality when button clicked
			        button.onclick = function( e ) { 
			        	// use setLetter function
			        	setLetter( this.getAttribute( "data-letter" ) ); 
			        	};
			        holder.appendChild(button);
			    }
			}
		
		
		else if (level=="easy"){
	// EASY
				// list of seven letters randomly reshuffled
				list=[0,1,2,3].sort( () => .5 - Math.random() );
				// clear letters
			    document.getElementById('region_letters').innerHTML ="";
			    // holder for letter space
			    holder = document.getElementById( "region_letters" );
			    // loop over letter list
			  	for( j = 0; j < 4;  j++) {
			  		// find corresponding letter
			  		i=list[j]
			  		// create a button element
			        button = document.createElement( "button" );
			        // set inner element of button to the letter
			        button.innerHTML = letters_easy[i];   
			        // set an attribute
			        button.setAttribute( "data-letter", letters_easy[i] );
			        // make first letter red 
			        if (i==0){
			        	button.style.color = 'red'; // setting the color to red
			        }
			        // functionality when button clicked
			        button.onclick = function( e ) { 
			        	// use setLetter function
			        	setLetter( this.getAttribute( "data-letter" ) ); 
			        	};
			        holder.appendChild(button);
			    }
	
		
		}
}
